import React, { useEffect, useState } from 'react'
import "../styles/Contact.css"
const Contact = () => {
    
    const [persondata , setpersondata] = useState({name:"" , email:"", phone:"" , message:""});
    const helper = async()=> {
        try {
            const res = await fetch('/getdata', {
                method: "GET",
                headers: {
                   
                    "Content-Type": "application/json"
                }
            });

            const data = await res.json();
      
            setpersondata({...persondata , name:data.name , email:data.email  , phone:data.phone});
            console.log(data);
            if(!res.status===200  ){
                console.log('bc');
                const error = new Error(res.error);
                throw error;
            }
        } catch (err) {
        console.log(err);
        console.log("mc");
        
    }
    }

    useEffect(()=>{
        helper();
    },[])
    
    const dp= (e)=>{
        const name =e.target.name ;
        const value = e.target.value ;
        console.log(name , value);
        setpersondata({...persondata , [name]:value});
    }

    const pd = async (e)=> {
        e.preventDefault();
        const { name, email, phone, message } = persondata;
        const res = await fetch('/contact', {
            method: "POST",
            headers: {
                "Content-Type": "application/json"
            },
            body: JSON.stringify({
                name, email, phone, message
            })
        });
        const data = await res.json();
        if(!data){
            console.log("connection not established");
        }else{
            alert("message sent");
            setpersondata({...persondata , message:""})
        }
       
    }
    

    return (
    <>
    <div className="contact_info pt-5 pb-100">
    <div className="container-fluid">
        <div className="row">
            <div className="col-lg-10 offset-lg-1 d-flex justify-content-betweeen"   style={{ justifyContent: 'space-evenly', flexWrap: 'wrap' }}>
             
                <div className="contact_info_item d-flex justify-content-start align-items-center" style={{ boxShadow: '0 0 10px rgba(0, 0, 0, 0.2)',
      border: '1px solid #eee', padding: '20px' ,width :"310px",margin:'10px',borderRadius:'20px'}} >
                    <img src="https://img.icons8.com/office/24/000000/iphone.png" alt="phone" />
                    <div className="contact_info_content" style={{ padding: '10px' }}>
                        <div className="contact_info_title">
                            Phone
                        </div>
                        <div className="contact_info_text">
                            +91 1111 543 2198
                        </div>
                    </div>
                </div>
                <div className="contact_info_item d-flex justify-content-start align-items-center" style={{ boxShadow: '0 0 10px rgba(0, 0, 0, 0.2)',
      border: '1px solid #eee', padding: '20px' ,width :"310px",margin:'10px',borderRadius:'20px'}} >
                    <img src="https://img.icons8.com/office/24/000000/iphone.png" alt="phone" />
                    <div className="contact_info_content" style={{ padding: '10px' }}>
                        <div className="contact_info_title">
                            Phone
                        </div>
                        <div className="contact_info_text">
                            +91 1111 543 2198
                        </div>
                    </div>
                </div>
                <div className="contact_info_item d-flex justify-content-start align-items-center" style={{ boxShadow: '0 0 10px rgba(0, 0, 0, 0.2)',
      border: '1px solid #eee', padding: '20px' ,width :"310px",margin:'10px',borderRadius:'20px'}} >
                    <img src="https://img.icons8.com/office/24/000000/iphone.png" alt="phone" />
                    <div className="contact_info_content" style={{ padding: '10px' }}>
                        <div className="contact_info_title">
                            Phone
                        </div>
                        <div className="contact_info_text">
                            +91 1111 543 2198
                        </div>
                    </div>
                </div>
                
            </div>
        </div>
    </div>
</div>  

{/* ///////////////////// */}
<div className="container-contact"  style={{ boxShadow: '0 0 10px rgba(0, 0, 0, 0.2)',
      border: '1px solid #eee'}}>
      <h2 className="heading-contact">Get in Touch</h2>
      <form>
        <div className="form-row-contact">
          <div className="form-group-contact">
          <label for="name"><i class="zmdi zmdi-account material-icons-name"></i></label>
          <input type="text" name="name" id="name" placeholder="Your Name" value = {persondata.name} onChange={dp} />
          </div>
          <div className="form-group-contact">
          <label for="email"><i class="zmdi zmdi-email"></i></label>
          <input type="email" name="email" id="email" placeholder="Email" value = {persondata.email} onChange={dp} />
          </div>
          <div className="form-group-contact">
          <label for="phone"><i class="zmdi zmdi-phone"></i></label>
          <input type="number" name="phone" id="phone" placeholder="Phone" value = {persondata.phone} onChange={dp} />
          </div>
        </div>
      
        <div className="form-group-contact">
          <textarea name="message" id="message-contact" cols="60" rows="7" placeholder="Message" onChange={dp} ></textarea>
        
        </div>
        <div><button class="btn btn-outline-dark" type="submit" onClick={pd}>Submit</button></div>

       
        
      </form>
    </div>
{/* /////////////////////// */}
    </>
  )
}

export default Contact
